    const [name, setName] = useState('Shrut â¤ï¸');
    const bgChange = () => {
        let newBg = '#34495e';
        setBg(newBg);
        setName('Pradnya ðŸ’“');
    }

    const bgBack = () => {
        let newBg = '#34495e';
        setBg(newBg);
        setName('Pradnya ðŸ’“');
    }


    return (
        <div style={ { backgroundColor : bg } }>
            <button onClick={bgChange} onDoubleClick={bgBack}> {name} </button>
        </div>
    );
}

export default App;
